import './App.css';
import { Routes, Route, useNavigate } from 'react-router-dom';
import SamplePage from './SamplePage';

function App() {

  let navigator = useNavigate();
  let member = [{ id: 100, name: 'Kim', department: 'S/W development', birthday: '2000-01-10'},
                { id: 101, name: 'Park', department: 'S/W development', birthday: '2001-02-11'}];
  return (
    <div className="App">
      <span onClick={()=>{navigator("/")}}>홈</span><br/>
      <button onClick={()=>{navigator("/member/0")}}>Member Page(Kim)</button><br/>
      <button onClick={()=>{navigator("/member/1")}}>Member Page(Park)</button><br/>
      <button onClick={()=>{navigator(-1)}}>뒤로가기..</button><br/>
      <hr className='horz-line'></hr>

      <Routes>
        <Route exact path="/" element={<div><h4>Home</h4></div>} />
        <Route path="/member/:idx" element={ <SamplePage  members={member} /> } />
      </Routes>

   </div>
  );
}

export default App;
